import React from 'react';
import ReactPlayer from 'react-player/'


const VideoPlayer = () => {
    return (
        <div>
            <div style ={{
            display: "flex",
            alignContent: "center",
            position: "relative",
            left: '20%',
            width: "100%",
            height: "100%",
            objectFit: "cover",

            }}>
            <ReactPlayer url="https://www.youtube.com/watch?v=JZjzQhFG6Ec&t=132s" controls={true} loop ={true} muted={false} autoplay={false} background={true} playing={false}  />
            </div>
        </div>
    );
};

export default VideoPlayer;
